Datasource.Parameter:
(
select way, ref, st_length(st_transform(way,4326)::geography)::integer as length from
(
select ST_LineMerge(ST_Union(way)) as way, ref from planet_osm_line where highway in ('motorway') group by ref
) as merged
) as data

(
select way, name, st_length(st_transform(way,4326)::geography)::integer as length from
(
select ST_LineMerge(ST_Union(way)) as way, name from planet_osm_line where waterway IN ('river', 'canal', 'stream', 'ditch') AND tunnel IS NULL AND (layer NOT IN ('-1', '-2') OR layer IS NULL) group by name
) as merged where name is not null order by length desc
) as data
